                } else {
                    notify.html('');
                    notify.append(login_notify_html(result.htmlMsg, result.htmlMsgType));
                }
            },
            error: function(ex) {
                notify.html('');
                notify.append(login_notify_html('There is an problem on connecting to server!', 'danger'));
